  constructor(){
    this.selectedTab = "unassigned"
  }
  
	public selectedTab: "unassigned" | "assigned" | "all";
  public tabsContentRef!: ElementRef;

  hAll() {
    this.unassigned = false;
    this.assigned = false;
    this.all = true;
    this.selectedTab="all";
    this.scrollTabContentTop();
    
  }
  hAssigned() {
    this.unassigned = false;
    this.assigned = true;
    this.all = false;
    this.selectedTab="assigned"
    this.scrollTabContentTop();
  }
  hUnassigned() {
    this.unassigned = true;
    this.assigned = false;
    this.all = false;
    this.selectedTab = "unassigned";
    this.scrollTabContentTop();
  }
  unassigned: boolean = true;
  assigned: boolean = false;
  all: boolean = false;

  
  private scrollTabContentTop():void{
    //this.tabsContentRef.nativeElement.scrollTo(0,0);
    this.tabsContentRef.nativeElement.scrollTop = 0;
  }
  
